import { InputGroup, InputGroupText, Input } from "reactstrap";
import { useState } from "react";

function Position({triggers, index}) {
    return (
        <>
            <h3>Position</h3>
            <InputGroup id='inputGroup'>
                <InputGroupText>X</InputGroupText>
                <Input placeholder={triggers[index]?.Position[0] || 0}></Input>
            </InputGroup>
            <br />
            <InputGroup id='inputGroup'>
                <InputGroupText>Y</InputGroupText>
                <Input placeholder={triggers[index]?.Position[1] || 0}></Input>
            </InputGroup>
            <br />
            <InputGroup id='inputGroup'>
                <InputGroupText>Z</InputGroupText>
                <Input placeholder={triggers[index]?.Position[2] || 0}></Input>
            </InputGroup>
            <br/>
        </>
    );
}

export default Position;
